<h2>Tree set elements order</h2>
<div class="step-text">
<p>What will be the result of running the code below?</p><pre><code class="language-java">public static void main(String[] args) {
   TreeSet&lt;Integer&gt; treeSet = new TreeSet&lt;&gt;();

    for (int i = 15; i &gt; 5; i--) {
        treeSet.add(i);
    }
    System.out.println(treeSet);
}</code></pre>
</div>
